function gerarPDF() {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();
  const logoBase64 = "data:image/png;base64,"

  // =====================================================
  // FUNO: HEADER INSTITUCIONAL (TOPO DE CADA PGINA)
  // =====================================================
  function desenharHeader(titulo) {
    // Faixa superior
    doc.setFillColor(245, 245, 245);
    doc.rect(0, 0, 210, 32, "F");

    // Logo proporcional
    if (logoBase64) {
      const imgProps = doc.getImageProperties(logoBase64);
      const ratio = imgProps.width / imgProps.height;

      const logoWidth = 38;
      const logoHeight = logoWidth / ratio;

      doc.addImage(logoBase64, "PNG", 10, 8, logoWidth, logoHeight);
    }

    // Texto institucional
    doc.setTextColor(40, 40, 40);

    doc.setFontSize(14);
    doc.text("CONTEDO PROGRAMTICO", 55, 16);

    doc.setFontSize(10);
    doc.text(titulo, 55, 23);
  }

  // =====================================================
  // CONTEDOS DAS CAPACITAES
  // =====================================================
  const textos = {

    nivel1:
`CAPACITAO NVEL 1  SOLIDWORKS

Introduo
 Tipos de arquivos
 Inteno de projeto
 Interface do SolidWorks

Esboo 2D
 Criao de esboos 2D
 Regras que governam os esboos
 Aplicao de dimenses

Modelagem Bsica
 Extruso
 Corte
 Filetes e arredondamentos
 Planos
 Recursos de revoluo
 Padres de repetio linear e circular

Visualizao e Detalhamento
 Vistas padro
 Opes de visualizao
 Detalhamento de desenhos tcnicos:
   Vistas de desenho
   Vistas de detalhe
   Vistas projetadas
   Vistas de seo
   Marcas e linhas de centro
   Dimenses
   Templates e formatos de folha
   Vistas de desenho de montagem
   Lista de materiais e tabelas
   Bales

Montagens
 Projetos ascendentes de montagem
 Insero de peas na montagem
 Posicionamentos:
   Coincidente
   Tangente
   Paralelo
   Simetria
   Largura
 Utilizao de montagens

Manuteno do Projeto
 Reparos
 Alteraes no projeto

Observao
Para adequar o horrio da capacitao s suas necessidades, a SKA oferece diferentes opes de turnos para sua realizao.
Em funo de valores diferenciados, consulte a Clusula Investimento  Servios.
`,

    nivel2:
`CAPACITAO NVEL 2  SOLIDWORKS

Objetivo
Capacitar o participante a utilizar o SolidWorks para modelagem de peas, montagens e chapas, com enfoque em geometrias complexas.

Pr-requisitos
Capacitao no curso SolidWorks Nvel I ou conhecimento de trabalho com o sistema CAD SolidWorks.

Carga horria
40 horas.

Configuraes e Recursos Avanados
 Configuraes de peas
 Configuraes de conjuntos
 Configuraes em detalhamentos
 Insero de peas em peas

Recursos de Modelagem Avanada
 Sweep
 Loft
 Shell
 Rib
 COSMOSXpress

Superfcies
 Superfcie extrudada
 Superfcie plana
 Aparar superfcie
 Costurar superfcie
 Trabalhar com imagens
 Superfcie por revoluo
 Superfcie varrida
 Modelagem hbrida

Grandes Montagens
 Componentes de peso leve
 Modo de grande montagem
 Abertura seletiva
 Uso de configuraes em grandes montagens
 Dicas para montagens mais rpidas
 Consideraes sobre desenhos

Posicionamentos Mecnicos
 Came
 Dobradia
 Engrenagem
 Pinho e cremalheira
 Parafuso
 Junta universal

Sheet Metal
 Mtodos de chapa metlica
 Calibres de chapa metlica
 Flanges
 Recursos de chapa metlica
 Flange contnuo
 Flange de aresta
`,

    nivel3:
`CAPACITAO NVEL 3  SOLIDWORKS

Objetivo
Capacitar o participante a utilizar as principais ferramentas do software SolidWorks para trabalhos com superfcies e criao de moldes, utilizando tcnicas automticas e manuais.

Pr-requisitos
Conhecimento dos recursos de modelagem avanada do SolidWorks, como Lofts e Sweeps.

Carga horria
28 horas.

Fundamentos de Superfcies
 Slidos e superfcies
 Introduo  superfcie extrudada
 Introduo  superfcie plana
 Aparar superfcie
 Introduo  costura de superfcies
 Fluxo de trabalho com superfcies
 Trabalhar com imagens
 Similaridades entre modelagem de slidos e superfcies
 Introduo  superfcie por revoluo
 Introduo  superfcie varrida
 Modelagem hbrida

Preparao para Moldes
 Importao de arquivos
 Anlise dos ngulos de extrao
 Fator de escala
 Linhas de partio
 Superfcies de partio

Criao de Moldes
 Criao de moldes
 Conserto de modelos e superfcies
 Mltiplas direes de partio
 Mtodos alternativos para desenho de moldes

Observao
Para adequar o horrio da capacitao s suas necessidades, a SKA oferece diferentes opes de turnos para sua realizao.
Em funo de valores diferenciados, consulte a Clusula Investimento  Servios.
`
  };

  // =====================================================
  // GERA PDF CONFORME CHECKBOX
  // =====================================================
  const selecionados = document.querySelectorAll(
    'input[type="checkbox"]:checked'
  );

  selecionados.forEach((checkbox, index) => {
    if (index > 0) doc.addPage();

    const titulo =
      checkbox.value === "nivel1" ? "SolidWorks  Nvel I" :
      checkbox.value === "nivel2" ? "SolidWorks  Nvel II" :
      "SolidWorks  Nvel III";

    desenharHeader(titulo);

    const texto = textos[checkbox.value];
    doc.setFontSize(11);
    doc.setTextColor(0, 0, 0);

    doc.text(texto, 10, 45, { maxWidth: 190 });
  });

  // ============================================
  // SALVAR
  // ============================================
  doc.save("capacitaes_solidworks.pdf");
}
